	add("treeiness", "{\"term\":\"treeiness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|tree|-y|-ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Resemblance to a tree\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1913\u0027\u0027, Royal Society of Arts, \u0027Journal of the Royal Society of Arts\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"found it necessary to discard the \u0027\u0027treeiness\u0027\u0027 of the tree and the grassiness of the grass\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1970\u0027\u0027, Morse Peckham, \u0027The triumph of Romanticism: collected essays\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"When we try to say what a tree is, we can only say that a tree is a manifestation of \u0027\u0027treeiness\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1974\u0027\u0027, Beatrice Kean Seymour, \u0027Summer of life\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"You know what I mean, anyway ‚Äî \u0027the \u0027\u0027treeiness\u0027\u0027 of the tree.\u0027 But I don\u0027t believe he\u0027s seen a picture by either\", \"priority\":7}]}, \"synonyms\":{}}");

	add("treemap", "{\"term\":\"treemap\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|tree|map|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A representation of hierarchical data as a set of nested rectangles\", \"priority\":1}]}, \"synonyms\":{}}");

	add("treeness", "{\"term\":\"treeness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|tree|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The essence of what it means to be a tree; the qualities that make a tree what it is\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1912\u0027\u0027, w:Dugald Sutherland D. S. MacColl, \u0026quot;A Year of \u0027Post-Impressionism\u0027\u0026quot;, in \u0027The Living Age\u0027, volume CCLXXIII, The Living Age Company, page [http://books.google.com/books?id\u003dqXkkAQAAIAAJ\u0026amp;pg\u003dPA163 163\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A tree may, for the imagination, present forcibly one of its qualities at a time; it may be a green dome of shade on a hot day, a ladder of retreat for a man from the attentions of a mad bull, a peg on which an apple hangs, a screen for an assassin, a choir for birds; and its own business of spreading out its million pores to the air and propagating its kind, which comes nearest to being its ‚Äú\u0027\u0027treeness\u0027\u0027,‚Äù may be what occupies the artist least and bores him most\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027 April 18, \u0026quot;Sans Will\u0026quot; (username), \u0026quot;[http://groups.google.com/group/soc.culture.vietnamese/msg/31cd0f7c9cbf4999 Re: DCC and Logic add a bit of philosophy and voila!..]\u0026quot;, in \u0026lt;tt\u0026gt;soc.culture.vietnamese\u0026lt;/tt\u0026gt;, \u0027Usenet\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A word represents the entity but not THE entity itself. \u0026quot;tree\u0026quot; is not a tree, you can call it \u0026quot;ca^y\u0026quot; or whatever but the conceptual meaning of \u0027\u0027treeness\u0027\u0027 stays the same\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, w:Arthur C. Arthur C. Danto, \u0026quot;Replies to Essays\u0026quot;, in Mark Rollins (ed.), \u0027Danto and His Critics\u0027, second edition, Wiley-Blackwell, ISBN 978-0-470-67344-7, page 290\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Let us say that the pigeons learned to recognize \u0027\u0027\u0027treeness\u0027\u0027\u0027, in the sense that they quickly enough learned to differentiate whatever exemplified \u0027\u0027treeness\u0027\u0027 from whatever did not\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The suitability of an evolutionary tree for representing the structure of a population; the degree to which a population structure can be accurately described as a tree of descent, with different branches evolving independently after they split\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1974\u0027\u0027, w:Luigi Luca L. L. Cavalli-Sforza \u0026amp; A. Piazza, \u0026quot;Analysis of Evolution: Evolutionary Rates, Independence and \u0027\u0027Treeness\u0027\u0027\u0026quot;, \u0027Theoretical Population Biology\u0027, volume 8, page 159\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"If factors that contribute to a tree-like pattern of the variance‚Äìcovariance matrix dominate the evolutionary picture over those that tend to destroy it, one can expect \u0027\u0027treeness\u0027\u0027 to be reasonably high. Only if this is true, reconstruction of the evolutionary process by tree analysis and a tree representation for descriptive purposes can be useful\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, w:Alan R. Alan R. Templeton, \u0026quot;Human Races: A Genetic and Evolutionary Perspective\u0026quot;, \u0027American Anthropologist\u0027, volume 100, pages 638‚Äì639\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"The computer programs used to generate ‚Äútrees‚Äù from genetic distance data will do so regardless of what evolutionary factors generated the distances. It is therefore the obligation of the users of such programs to ensure that the genetic distance data have the properties of \u0027\u0027treeness\u0027\u0027 before representing their data as a tree\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, w:G√≠sli G√≠sli P√°lsson, \u0027Anthropology and the New Genetics\u0027, Cambridge University Press, ISBN 978-0-521-85572-3, page 184\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Failing to statistically test for \u0027\u0027treeness\u0027\u0027, they reify the evolutionary trajectories assumed at the outset\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"The condition of being a tree; acyclicity and connectedness\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"1998\u0027\u0027, w:Joseph O\u0027Rourke Joseph O\u0027Rourke, \u0027Computational Geometry in C\u0027, second edition, Cambridge University Press, ISBN 0-521-64010-5, page 174\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"‚Ä¶such a tree can be built up incrementally by adding the shortest edge not yet explored, which also maintains \u0027\u0027treeness\u0027\u0027 (acyclicity\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Massimo Buscema \u0026amp; Pier L. Sacco, \u0026quot;Auto-contractive Maps, the \u0027H\u0027 Function, and the Maximally Regular Graph (MRG)\u0026quot;, in Vittorio Capecchi et al. (eds.), \u0027Applications of Mathematics in Models, Artificial Neural Networks and Arts\u0027, Springer, ISBN 978-90-481-8580-1, page 265\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"‚Ä¶every link that gives rise to a cycle into the graph (viz., that destroys the graph‚Äôs ‚Äú\u0027\u0027treeness\u0027\u0027‚Äù) is eliminated‚Ä¶\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Matthias Irmer, \u0027Bridging Inferences\u0027, De Gruyter, ISBN 978-3-11-026195-0, page 139\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"To save the \u0027\u0027treeness\u0027\u0027 of discourse structure¬†‚Äì and with that the supplied computational advantages¬†‚Äì Egg and Redeker (2008) argue that many apparent crossed dependencies reflect anaphoric relations on the level of discourse cohesion‚Ä¶. They opt for a pure tree structure for discourse relations, keeping anaphoric relations apart\", \"priority\":21}]}, \"synonyms\":{}}");

