	add("trekschuit", "{\"term\":\"trekschuit\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"English\", \"Dutch\"], \"text\":\"From Dutch \u0027trekschuit\u0027 from \u0027trekken\u0027 (pull) + \u0027schuit\u0027 (boat)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A horse-drawn canal boat or riverboat, used to carry goods or passengers in the Netherlands\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1749\u0027\u0027, Henry Fielding, \u0027Tom Jones\u0027, Folio Society 1973, p. 469\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"And thou, much plumper dame [...]: thee I call: of whom in a \u0027\u0027treckschuyte\u0027\u0027, in some Dutch canal, the fat Jufvrouw Gelt, impregnated by a jolly merchant of Amsterdam, was delivered\", \"priority\":3}]}, \"synonyms\":{}}");

