	add("trellis", "{\"term\":\"trellis\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Middle english (1100-1500) {{m|enm|trelis}}, from Anglo-norman {{m|fro|treslis}}, from Old french (842-ca. 1400) \u0027treille\u0027 (lang\u003dfro) from Latin \u0027trichila\u0027 (lang\u003dla)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An outdoor garden frame which can be used for partitioning a common area\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An outdoor garden frame which can be used to grow vines or other climbing plants\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A kind of graph used in communication theory and encryption\", \"priority\":3}]}, \"synonyms\":{}}");

	add("trema", "{\"term\":\"trema\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"Ancient greek (to 1453) \u0027œÑœÅ·øÜŒºŒ±|lang\u003dgrc\u0027 () from \u0027œÑŒµœÑœÅŒ±ŒØŒΩœâ|lang\u003dgrc\u0027 () used for the dots on dice, via Dutch \u0027trema\u0027 and French \u0027tr√©ma\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a diacritic consisting of two dots ( ¬® ) placed over a letter, used among other things to indicate umlaut or diaeresis\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027Trema\u0027\u0027 is a diacritic that I have to add to the letter like an accent. So to catalog correctly your system has to offer you \u0027\u0027Trema\u0027\u0027 and Umlaut.\u0027 ‚Äî Donald Pisani, [http://groups.google.com/groups?selm\u003dMAPI.Id.0016.00627770692020203737363630303546%40MAPI.to.RFC822\u0026amp;output\u003dgplain\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"If the tone is not falling, then a macron or \u0027\u0027trema\u0027\u0027 is written above the vowel: m√†t√∂\u0027. ‚Äî Rob Nierse, [http://listserv.brown.edu/archives/cgi-bin/wa?A2\u003dind9909D\u0026amp;L\u003dconlang\u0026amp;P\u003dR8167\", \"priority\":3}]}, \"synonyms\":{}}");

