	add("trench", "{\"term\":\"trench\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027trenche\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A long, narrow ditch or hole dug in the ground\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A narrow excavation as used in warfare, as a cover for besieging or emplaced forces\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A pit, usually rectangular with smooth walls and floor, excavated during an archaeological investigation\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A trench coat\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, April 24, Xiphias Gladius \u0026lt;ian@schultz.io.com\u0026gt;, \u0026quot;Re: trenchcoat mafia\u0026quot;, \u0027ne.general.selected\u0027, Usenet\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"I was the first person in my high school to wear a \u0027\u0027trench\u0027\u0027 and fedora constantly, and Ben was one of the first to wear a black \u0027\u0027trench\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, \u0027The Little Black Book of Style\u0027, HarperCollins, as excerpted in \u0027Elle\u0027, October, page 138\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A classic \u0027\u0027trench\u0027\u0027 can work in any kind of weather and goes well with almost anything\", \"priority\":8}]}, \"synonyms\":{}}");

	add("trencher", "{\"term\":\"trencher\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"French\", \"anglo-norman\"], \"text\":\"Middle english (1100-1500) \u0026lt; Anglo-norman \u0027trenchour\u0027 \u0026lt; \u0027trencheor\u0027 (French \u0027tranchoir\u0027 , from \u0027trenchier\u0027 (to cut, to carve) See \u0027trench\u0027 (verb).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A long plate on which food is served and/or cut\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1610\u0027\u0027, \u0027s:The The Tempest\u0027, by w:William Shakespeare, act 2 scene\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"No more dams I\u0027ll make for fish\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Nor fetch in firin\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"At requiring\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Nor scrape \u0027\u0027trenchering\u0027\u0027, nor wash dish\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Ban \u0027Ban, Ca‚ÄîCaliban\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Has a new master‚ÄîGet a new man\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"One who trenches; especially, one who cuts or digs ditches\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A machine for digging trenches\", \"priority\":10}]}, \"synonyms\":{}}");

	add("trencherman", "{\"term\":\"trencherman\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027trencher\u0027 + \u0027man\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who eats a substantial amount; a gourmand; one with a healthy appetite, and a cultivated appreciation for dining\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1599\u0027\u0027, w:William William Shakespeare, w:Much Ado About Much Ado About Nothing, s:Much Ado About Nothing Act 1 Scene 1\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"BEATRICE. You had musty victual, and he hath holp to eat it; he is a very valiant \u0027\u0027trencher-man\u0027\u0027; he hath an excellent stomach\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1954\u0027\u0027 June 28, \u0026quot;[http://www.time.com/time/magazine/article/0,9171,860901,00.html Sport: Bumbling Champ],\u0026quot; \u0027Time\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The heavyweight champion of the world was off his feed. . . . Rocky, ordinarily a first-rate \u0027\u0027trencherman\u0027\u0027, was pushing away from the breakfast table after downing only two eggs and a pair of lamb chops\", \"priority\":5}]}, \"synonyms\":{}}");

