	add("trepang", "{\"term\":\"trepang\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Malay\"], \"text\":\"From Malay \u0027teripang\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"B√™che-de-mer, sea cucumber\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1988\u0027\u0027, Tom Cole, \u0027Hell West and Crooked\u0027, Angus \u0026amp; Robertson 1995, p. 266\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"There had been a drop in the mother-of-pearl shell market and quite a few of the pearling luggers had turned their attention to diving for \u0027\u0027trepang\u0027\u0027, which had survived the ravages of the depression and was easy to recover, lying in shallow waters\", \"priority\":3}]}, \"synonyms\":{}}");

	add("trepidation", "{\"term\":\"trepidation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027trepidƒÅti≈ç\u0027 from \u0027trepid≈ç\u0027 (be agitated)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A fearful state; a state of hesitation or concern\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"I decided, with considerable \u0027\u0027trepidation\u0027\u0027, to let him drive my car without me\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1929\u0027\u0027, w:M. Barnard M. Barnard Eldershaw, \u0027w:A House is A House Is Built\u0027, Chapter VII, Section v\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"She opened the drawing-room door in \u0027\u0027trepidation\u0027\u0027. Would she find Esther drowned with her head in the goldfish bowl, or hanged from the chandelier by her stay-lace\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"An involuntary trembling, sometimes an effect of paralysis, but usually caused by terror or fear; quaking; quivering\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A libration of the starry sphere in the Ptolemaic system; a motion ascribed to the firmament, to account for certain small changes in the position of the ecliptic and of the stars\", \"priority\":6}]}, \"synonyms\":{}}");

