	add("tress", "{\"term\":\"tress\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\"], \"text\":\"From Old french (842-ca. 1400) \u0027tresce\u0027 of uncertain origin; possibly from *\u0027trichia\u0027 \u0026lt; Ancient greek (to 1453) Compare French \u0027tresse\u0027 Italian \u0027treccia\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A braid, knot, or curl, of hair; a ringlet\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A knot or festoon, as of flowers\", \"priority\":2}]}, \"synonyms\":{}}");

	add("trestle", "{\"term\":\"trestle\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027trestel\u0027 (crossbeam) (compare French \u0027tr√©teau\u0027 .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A horizontal member supported near each end by a pair of divergent legs, such as sawhorses\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A folding or fixed set of legs used to support a tabletop or planks\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1900\u0027\u0027, w:Charles W. Charles W. Chesnutt, \u0027The House Behind the Cedars\u0027, Chapter I\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"He turned the knob, but the door was locked. Retracing his steps past a vacant lot, the young man entered a shop where a colored man was employed in varnishing a coffin, which stood on two \u0027\u0027trestles\u0027\u0027 in the middle of the floor\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A framework, using spreading, divergent pairs of legs used to support a bridge\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A trestle bridge\", \"priority\":6}]}, \"synonyms\":{}}");

