	add("trevor", "{\"term\":\"trevor\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"from Welsh Trefor. Popular in the UK in the 1950s and the 1960s\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1941\u0027\u0027 w:Graham Graham Greene, \u0027The Destructors\u0027, Collected Stories, Heinemann 1941, page 32\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"He never wasted a word even to tell his name until that was required of him by the rules. When he said \u0027\u0027Trevor\u0027\u0027 it was a statement of fact, not as it would have been with the others a statement of shame or defiance. - - - There was every reason why T., as he was afterwards referred to, should have been an object of mockery - there was his name ( and they substituted the initial because otherwise they had no excuse not to laugh at it\", \"priority\":3}]}, \"synonyms\":{}}");

